	function ParseICSDate(icsDate, type) //refaire la fonction de james 
	{
		//type : time/date
		var year=0;
		var month=0;
		var day=0;
		var hour=0;
		var mins=0;
		var sec=0;

		//date building YYYY-MM-DD
		if(type=='date'){
		var year=icsDate.substring(0,4);
		var month=icsDate.substring(4,6);
		var day=icsDate.substring(6,8);

		var icsDate = year+"-"+month+"-"+day;	
		//time building hh:mm:ss Dont forget the "T" char in the middle
		}else
		{
		var hour=icsDate.substring(9,11);
		var mins=icsDate.substring(11,13);
		var sec=icsDate.substring(13,15);
		var icsDate = hour+":"+mins+":"+sec;
		}
		return icsDate;
	}
	
	function formICSdata(arg_summary,arg_location,arg_description,arg_dstart,arg_dtend,arg_action,arg_triger)
	{
      var fields =
	  {
        title: args_summary,
        location: arg_location,
        description: arg_description,
        calendarId: "local-first"
      };

      var startTime = arg_dstart;
      var endTime = arg_dtend;
 
      fields.startDate = ParseICSDate(startTime,"date");
      fields.endDate = ParseICSDate(endTime,"date");
 
		fields.alarms = [];
		fields.alarms.push(
		{
			action: arg_action,
			trigger: arg_triger
		});

      return fields;
    }


	// file drag hover
	function FileDragHover(e) {
		e.stopPropagation();
		e.preventDefault();
		e.target.className = (e.type == "dragover" ? "hover" : "");
		
	}

	// file selection
	function FileSelectHandler(e) {

		// cancel event and hover styling
		FileDragHover(e);

		// fetch FileList object
		var files = e.target.files || e.dataTransfer.files;

		// process all File objects
		for (var i = 0, f; f = files[i]; i++) {
			getCalendar(f);
		}

	}

